const numberOfSubstrings = require("./solution");

describe('Number of Substrings Containing All Three Characters', () => {
  test('Quantity of substrings that contain at least a,b and c is 10', () => {

    const s = "abcabc"

    expect(numberOfSubstrings(s)).toBe(10)
  });

  test('Quantity of substrings that contain at least a,b and c is 3', () => {

    const s = "aaacb"

    expect(numberOfSubstrings(s)).toBe(3)
  });

  test('Quantity of substrings that contain at least a,b and c is 1', () => {

    const s = "abc"

    expect(numberOfSubstrings(s)).toBe(1)
  });

  test('Quantity of substrings that contain at least a,b and c is 44424996', () => {

    const s = ``

    expect(numberOfSubstrings(s)).toBe(44424996)
  });

  test('Quantity of substrings that contain at least a,b and c is 1244858478', () => {

    const s  = ``

    expect(numberOfSubstrings(s)).toBe(1244858478)
  });

  test('Quantity of substrings that contain at least a,b and c is 49998', () => {

    const s  = ``

    expect(numberOfSubstrings(s)).toBe(49998)
  });
});